INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 2, "ヤマト", "2030/01/01 14:59:59", 3001, 2.1, 1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, 0.0, 3001100, 100, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 2, "ヤマト", "2030/01/01 14:59:59", 3001, 5.68, 4, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 130011, 0.0, 3001101, 101, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 1, "ヤマト", "2030/01/01 14:59:59", 3001, 0.0, 1, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 130011, 0.0, 3001102, 102, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 1, "フブキ", "2030/01/01 14:59:59", 3002, 0.0, 1, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 130211, 0.0, 3002100, 100, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 1, "フブキ", "2030/01/01 14:59:59", 3002, 0.0, 1, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 130211, 0.0, 3002101, 101, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 2, "フブキ", "2030/01/01 14:59:59", 3002, 8.53, 5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 130211, 0.0, 3002102, 102, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 1, "フブキ", "2030/01/01 14:59:59", 3002, 5.67, 7, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 130211, 0.0, 3002103, 103, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 1, "フブキ", "2030/01/01 14:59:59", 3002, 0.0, 1, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 130211, 0.0, 3002104, 104, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 3, "フブキ", "2030/01/01 14:59:59", 3004, 0.0, 3, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 130211, 0.0, 3002300, 300, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 7, "フブキ", "2030/01/01 14:59:59", 3005, 0.0, 7, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 130211, 0.0, 3002400, 301, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 1, "フブキ", "2030/01/01 14:59:59", 3003, 4.4, 2, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 130211, 0.0, 3003200, 200, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 7, "フブキ", "2030/01/01 14:59:59", 3003, 0.0, 7, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 130211, 0.0, 3003201, 201, "2024/10/31 12:00:00");
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (-416.5, 2, "フブキ", "2030/01/01 14:59:59", 3003, 5.6, 1, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 130211, 0.0, 3003202, 202, "2024/10/31 12:00:00");
